import React from 'react';

import './progress-bar.styles.scss';

const ProgressBar = props => {
  const { progress } = props
  return(
    <div class="progress">
      <div 
        class="progress-bar" 
        role="progressbar" 
        aria-valuenow="25" 
        aria-valuemin="0" 
        aria-valuemax="100" 
        style={{ width: progress + "%"}}
      >
        { progress + "%" }
      </div>
    </div>
  )
}

export default ProgressBar;
